Let's think step-by-step about modeling responder behavior in this economic game.

**Key Psychological Mechanisms:**

1. **Fairness:** Responders likely consider the fairness of the proposed split.  A split perceived as unfair (significantly deviating from an equal split, considering the relative token contributions) will likely lead to rejection.

2. **Self-Interest:** Responders will also prioritize maximizing their own monetary gain.  A sufficiently high offer, even if slightly unfair, might be accepted.

3. **Relative Contributions:** The ratio of `token_self` to `token_opp` significantly influences the perception of fairness.  A proposer who contributes less might face more rejections for the same percentage split.

4. **Risk Aversion:** Responders might be risk-averse, preferring a certain smaller gain to a gamble on a potentially larger gain (if the split is barely acceptable).


**How these Mechanisms Interact:**

Fairness and self-interest are likely to interact antagonistically. A very unfair offer might be rejected even if it offers a substantial monetary gain. The relative contributions moderate the influence of fairness.  Risk aversion will introduce noise around the decision boundary between acceptance and rejection.


**Mathematical Form:**

We can capture these interactions using a utility function that combines the perceived fairness, the monetary gain, and a risk aversion parameter.  A logistic function will transform the utility into a probability of acceptance.

**Parameters:**

We will need parameters to capture the weight given to fairness, self-interest, and risk aversion, as well as a scaling factor for relative contributions.

**Model Variables Mapping to Observable Behavior:**

The model will use `split_perc_self`, `token_self`, `token_opp`, and `combined_earning` as inputs to estimate the utility of acceptance. A logistic function will then predict the probability of acceptance.


<MODEL>
U =  α * (split_perc_self - 50) + β * (split_self / combined_earning) + γ * (token_self / (token_self + token_opp)) * (split_perc_self - 50) - δ * (1 - split_perc_self/100)^2

P(accept = 1) = 1 / (1 + exp(-U))
</MODEL>

<VARIABLES>
{
  "variables": {
    "U": {
      "description": "Utility of accepting the offer",
      "range": {
        "min": "-inf",
        "max": "inf"
      },
