      "range": {
        "min": -10,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "gamma": {
      "description": "Weight given to fairness moderated by relative contributions",
      "range": {
        "min": -10,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "delta": {
      "description": "Risk aversion parameter (penalizes deviations from 100% split)",
      "range": {
        "min": 0,
        "max": 10
      },
      "learnable": true,
      "source": "learnable"
    },
    "split_perc_self": {
      "description": "Percentage of total earnings proposed to the participant",
      "range": {
        "min": 0,
        "max": 100
      },
      "learnable": false,
      "source": "data"
    },
    "split_self": {
      "description": "Amount of money proposed to the participant",
      "range": {
        "min": 0,
        "max": 1000
      },
      "learnable": false,
      "source": "data"
    },
    "combined_earning": {
      "description": "Total amount of money earned in the trial",
      "range": {
        "min": 0,
        "max": 1000
      },
      "learnable": false,
      "source": "data"
    },
    "token_self": {
      "description": "Number of tokens found by the participant",
      "range": {
        "min": 0,
        "max": 100
      },
      "learnable": false,
      "source": "data"
    },
    "token_opp": {
      "description": "Number of tokens found by the opponent",
      "range": {
        "min": 0,
        "max": 100
      },
      "learnable": false,
      "source": "data"
    },
    "P(accept = 1)": {
      "description": "Probability of accepting the offer",
      "range": {
        "min": 0,
        "max": 1
      },
      "learnable": false,
      "source": "calculated"
    }
  }
}
</VARIABLES>

<target_variable>accept</target_variable>

